import React from 'react';
import SideNavbar from '../Components/SideNavbar';

const Dashboard = () => {
  // const transactionData = [
  //   { category: 'Pemasukan', totalAmount: 1500000 },
  //   { category: 'Pengeluaran', totalAmount: 750000 },
  //   { category: 'Investasi', totalAmount: 300000 },
  //   { category: 'Hiburan', totalAmount: 500000 },
  //   { category: 'Tagihan', totalAmount: 200000 },
  // ];

  const items = [
    { name: 'Sabun Mandi', qty: 2, price: 10000 },
    { name: 'Shampoo', qty: 1, price: 15000 },
    { name: 'Pasta Gigi', qty: 3, price: 8000 },
  ];

  // Menghitung total
  const calculateTotal = () => {
    return items.reduce((total, item) => total + item.qty * item.price, 0);
  };

  return (
    <div class='text-center'>
      <div class='row'>
        <SideNavbar />
        {/* ini buat dashboard */}
        <div class='col-10 '>
        <h3 className="card-title text-center">Struk Belanja</h3>
          <hr />
          <div className="row">
            <div className="col-6">
              <p><strong>Nama Toko:</strong> Toko Sejahtera</p>
            </div>
            <div className="col-6 text-end">
              <p><strong>Tanggal:</strong> 10 Oktober 2024</p>
            </div>
          </div>
          <table className="table mt-4">
            <thead>
              <tr>
                <th>Nama Produk</th>
                <th>Jumlah</th>
                <th>Harga Satuan</th>
                <th>Total</th>
              </tr>
            </thead>
            <tbody>
              {items.map((item, index) => (
                <tr key={index}>
                  <td>{item.name}</td>
                  <td>{item.qty}</td>
                  <td>Rp {item.price.toLocaleString()}</td>
                  <td>Rp {(item.qty * item.price).toLocaleString()}</td>
                </tr>
              ))}
            </tbody>
          </table>


        </div>
      </div>
    </div>
  );
};

export default Dashboard;
